import React from 'react';
import './MessageRecieved.css'

const MessageRecieved = () => {
  return (
    <>
      <div className='message'>
        <h1>Message Recieved</h1>
        <h1>Thank You So Much</h1>
      </div>
    </>
  );
}

export default MessageRecieved;
